import React from 'react';
import '../styles.css';

const AboutUs = () => {
  return (
    <section id="about-us" className="section">
      <h2>About Us</h2>
      <p>
        We are Rainbow Vista Art, dedicated to bringing vibrant theatrical performances to life.
        Our mission is to captivate and inspire audiences through our colorful and dynamic shows.
      </p>
      
    </section>
  );
}

export default AboutUs;
